import React from "react"

const Results = props => (
    <ul id={props.id}>
      <li>Title: {props.title}</li>
      <li>Link: {props.url}</li>
      <button className="btnSave" onClick={() => props.save(props.id)}>Save</button>
      <li>Published on {props.date} at {props.time}</li>
    </ul>
);

export default Results;
